import { Route, Routes } from 'react-router-dom';
import Home from './Home.js';
import EditForm from './editform.js';

export const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/create-post" element={<EditForm />} />
      <Route path="/Ppaysaggam" element={<Pay />} />
    </Routes>
  );
};
